import React from "react";

const About = () => {
  return (
    <div className="about-container" data-aos="fade-up">
      <h2 className="about-header">About Me</h2>
      <p className="about-paragraph">
        Hello! I'm a passionate and dedicated software developer currently
        pursuing a Bachelor of Science in Computer Science with a minor in Data
        Science at the University of Calgary. My journey in tech has been fueled
        by a love for creating innovative applications and solving complex
        problems. With a strong foundation in various programming languages and
        technologies, I continuously strive to enhance my skills and stay
        updated with the latest industry trends. I'm enthusiastic about
        leveraging technology to make a positive impact and am always eager to
        take on new challenges.
      </p>
    </div>
  );
};

export default About;
